import React from "react";
import {useState,useEffect} from "react";
import { Link,useHistory } from "react-router-dom";
import { PostPokemonCreate,GetTypes } from "../actions";
import { useDispatch,useSelector } from "react-redux";

export default function PokemonCreate(){
    const dispatch= useDispatch();
    const Types = useSelector((state)=> state.allTypes) ;
    const [input,setInput] = useState (
                                        {                                
                                            name:"",
                                            hp:"",
                                            attack:"",
                                            defense:"",
                                            img:"",
                                            speed:"",
                                            height:"",
                                            weight:"",
                                            type:[]
                                        });



useEffect(()=> {
    dispatch(GetTypes())
},[dispatch]);

function hadleChange(e) {
    setInput({
        ...input,
        [e.target.name] : e.target.value
    })
}
function hadleCheck(e) {
    var deleteT =input.type.includes(type)&& e.target.checked===false? input.type.filter(e=> e!==type) : input.type;
    console.log(input.type);
    console.log(deleteT)
    var type=e.target.name;
    if (e.target.checked && !input.type.includes(type)) {
        setInput({
            ...input,
            type: input.type.concat(type)
        })
    }
    

}

function check(e) {
    var name=e.target.name
var types= Types.map(e => e.name)
var typesF=types.filter(e=> e===name)
var typesB=input.type.includes(name)&& e.target.checked===true? input.type : setInput({
    ...input,
    type: input.type.concat(name)
});

var typesC=input.type.includes(name)&& e.target.checked===false? input.type.filter(e=> e!==name) : input.type;

console.log(typesB);
//console.log(typesC);


    
    
    
}






return(
    <div>
        <Link to='/pokemons'><button> Return </button></Link>
        <h1>create your pokemon</h1>
        <form>
            <div>
                <label>Nombre</label>
                <input type="text" value={input.name} name="name" onChange={hadleChange}></input>
            </div>
            <div>
                <label>Hp</label>
                <input type="number" value={input.hp} name="hp" onChange={hadleChange}></input>
            </div>
            <div>
                <label>Attack</label>
                <input type="number" value={input.attack} name="attack" onChange={hadleChange}></input>
            </div>
            <div>
                <label>Defense</label>
                <input type="number" value={input.defense} name="defense" onChange={hadleChange}></input>
            </div>
            <div>
                <label>img</label>
                <input type="text" value={input.img} name="img" onChange={hadleChange}></input>
            </div>
            <div>
                <label>speed</label>
                <input type="number" value={input.speed} name="speed" onChange={hadleChange}></input>
            </div>
            <div>
                <label>height</label>
                <input type="number" value={input.height} name="height" onChange={hadleChange}></input>
            </div>
            <div>
                <label>weight</label>
                <input type="number" value={input.weight} name="weight" onChange={hadleChange}></input>
            </div>
            {Types?.map( (e) => {
                return( 
            <div>
                <label>{e.name}</label>
                <input type="checkbox" name={e.name}  onChange={(e)=>hadleCheck(e)}  key={e.id+"qwe" }></input>
            </div> )
}) }


        </form>

    </div>
)
}
